import * as React from 'react';
import { StringValueNode } from 'graphql';

interface Props {
  title: string;
  description: string;
  links?: String;
}

export const SimplePaymentsCard: React.FC<Props> = ({
  title,
  description,
  links
}) => {
  return (
    <div className='w-1/3'>
      <div className='w-85p text-gray-750'>
        <div className='my-3'>
          <h3 style={{ fontFamily: 'airbnb-bold' }} className='text-2xl'>
            Charge what you want
          </h3>
        </div>
        <div>
          <p style={{ fontFamily: 'airbnb-book' }}>
            You always get to pick your price. Need help? We have tools to help
            you match demand in your area.
          </p>
        </div>
      </div>
    </div>
  );
};
